import React from 'react';
import NavBar from './NavBar';

const Home = () => {
    return (
        <div>
            <NavBar />
           <div className="d-flex justify-content-center align-items-center" style={{ height: "90vh"}}>
               <div>
                   <h1>Home Page</h1>
               </div>
           </div>
        </div>
    );
};

export default Home;
